import React, { Component } from 'react';

class ResultList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: this.props.data
    };
  };



  render() {
    return (
      <ul>
        {
          this.state.data.map((el, index) => {
            return <li key={index}>{el.name}</li>
          })
        }
      </ul>
    );
  }
};

export default ResultList;
